public static ThreeLongs fromString(String s) {
  String parts[] = s.split(":");
  assert parts.length == 3;
  return new ThreeLongs(Long.parseLong(parts[0], 16), Long.parseLong(parts[1], 16), Long.parseLong(parts[2], 16));
}

